(37, 1, '2019-03-12 20:41:38', '2019-03-12 20:41:38', '<p>Do you see what I like about shortcodes? These use cases are the type of random need that can come up on the PHP side of any WordPress project, and in each case registering a shortcode was a very simple, easy way to turn my PHP code into something visual I could work with and get feedback from. In general, shortcodes are one of the easiest and lightweight-iest ways for a WordPress developer to get stuff—any stuff—to display onto the page, so you can use it, debug it, test it, tweak it, and what have you. And you know exactly where to expect it on the page, because you’ve placed the shortcode yourself.[quotes align=\"left\"]Welcome to WordPress. This is your first post. Edit or delete it, then start writing![/quotes]\r\nSo if you don’t know how to get your code onto the page, don’t reach for custom page templates, the_content filters, or anything else. Reach for a shortcode.. Instead of dropping an image into the text, let the image float above it (look at how the images and text wrap on this site).\r\nText wraps can be tricky. Successful wrapping depends on the size of image, size of text and with of column where everything lives. Make sure your wrap passes the eye test and text is easier, not more difficult to read, with the addition of a text wrap.</p>', 'The unicorn were voted \"Consistently Excellent\" Pub of the Year', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2019-03-12 20:41:38', '2019-03-12 20:41:38', '', 35, 'http://infinum-test.mydev/35-revision-v1/', 0, 'revision', '', 0),
